import React, { useState, useEffect } from 'react'
import Header from './Header'
import axios from "axios";

const List = () => {

    const [users, setUser] = useState([])

      useEffect(() => {
        async function fetchData() {
          try {
            const res = await axios.get('http://localhost:4000/Route/index/userslist',users);
            console.log(res.data);
            setUser(res.data);
          } catch (error) {
            console.error(error);
          }
        }
        fetchData();
      }, []);

  return (
  <>
    <Header/>
    <div className="container mt-5">
        <table class="table table-striped">
          <thead>
            <tr>
              <th scope="col">Id</th>
              <th scope="col">Name</th>
              <th scope="col">Email</th>
              <th scope="col">Hobbies</th>
            </tr>
          </thead>


    {users.map && users.hobbies.map((hobbi,index) =>(
      <div key={index}>{hobbi}</div>
    ))}
          <tbody>
            {
              users.map((item, index) => {
                return (
                  <tr key={index}>
                    <td>{item.id}</td>
                    <td>{item.fname}</td>
                    <td>{item.email}</td>
                    <td>{item.hobbies}</td>
                  </tr>
                );
              })}
          </tbody>
        </table>

      </div>
  </>
  )
}

export default List
